import React from 'react';

function Food({ name, amount }) {
  return (<div>
    <h3>i love {name}</h3>
    <h4>price is {amount}</h4>
  </div>);
}

const favroiteFood = [
  {
    name: "kimchi",
    price: "high"
  },
  {
    name: "gimbap",
    price: "chip"
  },
  {
    name: "짜장면",
    price: "middium"
  }
];

function App() {
  return (
    <div >
      {favroiteFood.map(dish => <Food name={dish.name} amount={dish.price} />)}
    </div>
  );
}

export default App;
